  true,\n\t\"url\": null,\n\t\"notes\": \"The U.S. Bioenergy Statistics are a source
  of information on biofuels intended to present a picture of the renewable energy
  industry and its relationship to agriculture.  Where appropriate, data are presented
  in both a calendar year and the relevant marketing year timeframe to increase utility
  to feedstock-oriented users.  The statistics highlight the factors that influence
  the demand for agricultural feedstocks for biofuels production; for instance, numerous
  tables emphasize the relationship between energy and commodity markets.\",\n\t\"license_title\":
